import React from "react";

class Weather extends React.Component {
    render() {
        return (
            <div>
                {this.props.city &&
                <div>
                    <p>Месторасположение: {this.props.city}, {this.props.country}</p>
                    <p>Температура(min, max): {this.props.temperature} ( {this.props.temperature_min}, {this.props.temperature_max} ) </p>
                    <p>Макс. температура: {this.props.temperature_max}</p>
                    <p>Мин. температура: {this.props.temperature_min}</p>
                    <p>Влажность: {this.props.humidity}</p>
                    <p>Давление: {this.props.pressure}</p>
                    <p>Заход солнца: {this.props.sunset}</p>
                </div>
                }
                <p>{this.props.error}</p>
            </div>
        );
    }
}

export default Weather;
